import React from 'react'
import logo from '../img/logo.png';
const Navbar = () => {
  return (
    <div className='navbar'>
      <img  src={logo} alt="" />
      <ul className="nav-menu"></ul>
      <li>SignUp</li>
      <li></li>
      <li></li>
    </div>
  )
}

export default Navbar
